export const COLUMNS = [
    {
        Header: 'Name',
        accessor: 'name',
        Cell: e =><a href={e.value}> {e.value} </a>,      
        disableSortBy: true        
    },
    {
        Header: 'Description',
        accessor: 'description',
        disableSortBy: true
    },
    {
        Header: 'Price',
        accessor: 'initial_price',
        disableGlobalFilter: true
    }
]
